import React from 'react';

const CharComponent = (Props) =>{

    const style = {
       display : 'inline-block',
       padding : '16px',
       textAlign : 'center',
       margin : '16px',
       border : '1px solid black'
    }
    return(
        <div style={style} onc>
         {Props.Character} 
        </div>
    )
}

export default CharComponent;
